import './Item.css'

const Item = ({ item }) => {
    return (
        <div className='card-container'>
            <h1>{item.name}</h1>
            <p>{item.desc}</p>

            <div className='card-footer'>
                <h3>${item.price}</h3>
                <Button text="ADD"></Button>
            </div>

        </div>

    );
};

export default Item
